s=\"entry-title\" itemprop=\"headline\">Contact</h1> \n</header><div class=\"entry-content\" itemprop=\"text\"><div class=\"protcted_area\"><h3>Contacting Me</h3>\n<p>Hello Gentlemen, Discretion is a key stone in this industry and very important to myself and I assume it is just as important if not more important to yourself. With that being said, I always am discrete and strive to be as professional as possible.I am always polite and respectful and ask that you please be the same.</p>\n<p>If you have any questions that need to be discussed via phone I am available for this as well. However, I cannot always guarentee I will be available to discuss things at a moments notice due to where or what I am doing at the time.</p>\n<p>Should you require discussion via phone please be patient and or check with me by text prior to calling. If I do not answer right away I will as soon as I possibly can. (Please keep in mind I do have a life outside of this)</p>\n<p>When contacting me please also keep in mind I do screen who I see for safety and discretion but also to know a bit about who I am meeting. This ensures that we both mutually enjoy our time together and have the best experience. \ud83d\ude09 Please if using my contact forum be sure to fill it in completely or at the very least the email portion because if you do not do this I will unfortunately not be able to reply/respond.</p>\n<p>Also due to the fact I screen who I see it is best to include Name, Age, Profession or anything else you may be comfortable with sharing with me. <img src=\"http://www.misslust.ca/wp-includes/images/smilies/simple-smile.png\" alt=\":)\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> If on any of the review boards/forums please include your handle/screen name as well as send me a private message to verify. This helps speed up the screening process and allows us to skip the back and forth mails, texts, or calls that can sometimes take forever and result in playing a game of tag which is no fun for anyone.</p>\n<p>Thank you for interest and for visiting my website, and I hope and look forward to hearing from you! If you do contact me\u00a0 I will always be discrete, polite, and respectful and I ask that you please be the same. No vulgar or abusive behaviour will be tolerated and if you choose to be this way I will ignore and block you from further communication. &lt; (you will also be blacklisted) &gt;</p>\n<p>Best method of contacting me for the quickest responses please text me at (780) 691-8545 or (604) 889-9464.</p>\n<p>Follow me on Twitter: @lust_athena</p>\n<p class=\"signature\" style=\"font-size: 30px;\">Miss. Athena Lust XoXo</p>\n<p>&nbsp;</p>\n<div>\n<div class=\"one-half first\">\t<div id=\"ninja_forms_form_1_cont\" class=\"ninja-forms-cont\">\n\t\t<div id=\"ninja_forms_form_1_wrap\" class=\"ninja-forms-form-wrap\">\n\t<div id=\"ninja_forms_form_1_response_msg\" style=\"\" class=\"ninja-forms-response-msg \"></div>\t<form id=\"ninja_forms_form_1\" enctype=\"multipart/form-data\" method=\"post\" name=\"\" action=\"\" class=\"ninja-forms-form\">\n\n\t<input type=\"hidden\" id=\"_wpnonce\" name=\"_wpnonce\" value=\"d5cd56f056\" /><input type=\"hidden\" name=\"_wp_http_referer\" value=\"/contact/\" />\t<input type=\"hidden\" name=\"_ninja_forms_display_submit\" value=\"1\">\n\t<input type=\"hidden\" name=\"_form_id\"  id=\"_form_id\" value=\"1\">\n\t\t<div class=\"hp-wrap\">\n\t\t<label>If you are a human and are seeing this field, please leave it blank.\t\t\t<input type=\"text\" value=\"\" name=\"_EGyrH\">\n\t\t\t<input type=\"hidden\" value=\"_EGyrH\" name=\"_hp_name\">\n\t\t</label>\n\t</div>\n\t\t<div id=\"ninja_forms_form_1_all_fields_wrap\" class=\"ninja-forms-all-fields-wrap\">\n\t\t\t<div class=\"ninja-forms-required-items\">Fields marked with an <span class=\"ninja-forms-req-symbol\">*</span> are required</div>\n\t\t\t\t\t\t\t\t<div class=\"field-wrap text-wrap label-above\"  id=\"ninja_forms_field_1_div_wrap\" data-visib