itemprop=\"headline\">Etiquette</h1> \n</header><div class=\"entry-content\" itemprop=\"text\"><div class=\"protcted_area\"><p>I truly enjoy our time together so to be sure we can fully enjoy our time together I ask that you show up clean and with proper hygiene.</p>\n<p>I am a professional companion and as such, I promise to always treat you with respect and expect nothing less in return. Any disrespectful behavior will not be tolerated and will result in the end of our time together without a refund.</p>\n<p>**I do ask when seeing you that you please freshen up and or shower at the start of our appointment to ensure our time together is the best it can be..</p>\n<p>**Please have the donation prepared ahead of time in a unsealed envelope, I prefer not to have to ask for the donation so please put it on the counter immediately upon arrival.</p>\n<p>You will be asked to leave if you are under the influence of ANY *Drug* and or if you have drank to much (Alcohol)</p>\n<p><strong>Specials/Discounts</strong></p>\n<p>I take great pride in my services and my donations are non negotiable, so please do not ruin the mood by asking or bartering on my donation. I do at times run customer appreciation or specials on my donations.</p>\n<p>Rest assured that our time together will never be rushed. I do understand that sometimes a few extra minutes are needed, However please do not try to stay over your allotted time as I do like to keep a schedule.</p>\n<p><strong>Discretion</strong></p>\n<p>Please do not approach me in public settings. Your discretion is my number one priority so please do the same.</p>\n<p>**If you choose to dis-respect, myself, my boundaries and or my restrictions I will ask you to leave with no refund and no future bookings as well as being black listed**</p>\n<p class=\"signature\" style=\"font-size: 30px;\">Miss. Athena Lust XoXo</p>\n</div></div></article></main><aside class=\"sidebar sidebar-primary widget-area\" role=\"complementary\" aria-label=\"Primary